import "./App.css";

function App() {
  function test() {
    async function fetchData() {
      const response = await fetch("http://localhost:3000/forsinkelser")
        .then((response) => response.json())
        .then((data) => {
          console.log(data);
        })
        .catch((error) => console.error(error));
    }

    fetchData();
  }
  return (
    <div className="App">
      <button onClick={test}>TEST</button>
    </div>
  );
}

export default App;
